import React from 'react';
import './Navbar.scss';

export class Navbar extends React.Component
{ constructor(props)
    {
        super(props);
    }
    // createContact()
    // { this.props.createHandler();

    // }
    render()
    {
        return (
            <nav>
            
            <h1 className="title">To-do App</h1>
            
            <span className="create" onClick={this.props.createHandler}><img alt = "Create" src="assets/icon-content-create_24px.png"></img>

            </span>
            </nav>
            );
    }
}
